import com.hedera.services.legacy.core.jproto.TxnReceipt;
import com.hedera.test.serde.SelfSerializableDataTest;
import com.hedera.test.utils.SeededPropertySource;
import com.swirlds.common.constructable.ClassConstructorPair;
import com.swirlds.common.constructable.ConstructableRegistry;
import com.swirlds.common.constructable.ConstructableRegistryException;

import java.util.Collections;

import static com.hedera.services.state.submerkle.ExpirableTxnRecord.RELEASE_0230_VERSION;
import static com.hedera.services.state.submerkle.ExpirableTxnRecord.RELEASE_0250_VERSION;
import static com.swirlds.common.CommonUtils.unhex;

public class ExpirableTxnRecordSerdeTest extends SelfSerializableDataTest<ExpirableTxnRecord> {
	@Override
	protected Class<ExpirableTxnRecord> getType() {
		return ExpirableTxnRecord.class;
	}

	@Override
	protected void registerConstructables() throws ConstructableRegistryException {
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(TxnId.class, TxnId::new));
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(TxnReceipt.class, TxnReceipt::new));
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(FcTokenAssociation.class, FcTokenAssociation::new));
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(FcAssessedCustomFee.class, FcAssessedCustomFee::new));
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(NftAdjustments.class, NftAdjustments::new));
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(CurrencyAdjustments.class, CurrencyAdjustments::new));
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(EvmFnResult.class, EvmFnResult::new));
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(EntityId.class, EntityId::new));
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(FcTokenAllowance.class, FcTokenAllowance::new));
		ConstructableRegistry.registerConstructable(
				new ClassConstructorPair(FcTokenAllowanceId.class, FcTokenAllowanceId::new));
	}

	@Override
	protected int getNumTestCasesFor(int version) {
		return version == RELEASE_0230_VERSION ? num0240Forms : hexedForms.length - num0240Forms;
	}

	@Override
	protected byte[] getSerializedForm(int version, int testCaseNo) {
		return unhex(getHexedForm(version, testCaseNo));
	}

	@Override
	protected ExpirableTxnRecord getExpectedObject(int version, int testCaseNo) {
		if (version == RELEASE_0230_VERSION) {
			final var seeded = nextSeededRecord(version, testCaseNo);
			// Always empty before release 0.25
			seeded.setCryptoAllowances(Collections.emptyMap());
			seeded.setFungibleTokenAllowances(Collections.emptyMap());
			return seeded;
		} else if (version == RELEASE_0250_VERSION) {
			return nextSeededRecord(version, testCaseNo);
		} else {
			throw new IllegalArgumentException("Version " + version + " isn't actually supported");
		}
	}

	private ExpirableTxnRecord nextSeededRecord(final int version, final int testCaseNo) {
		final var propertySource = SeededPropertySource.forSerdeTest(version, testCaseNo);
		// Releases 0.23/4 and 0.25 all used the same fields; only serialization format changed
		final var builder = ExpirableTxnRecord.newBuilder()
				.setTxnId(propertySource.nextTxnId())
				.setReceiptBuilder(propertySource.nextReceiptBuilder())
				.setConsensusTime(propertySource.nextRichInstant())
				.setFee(propertySource.nextUnsignedLong())
				.setNumChildRecords(propertySource.nextUnsignedShort());
		if (propertySource.nextBoolean()) {
			builder.setAlias(propertySource.nextByteString(32));
		}
		if (propertySource.nextBoolean()) {
			builder.setHbarAdjustments(propertySource.nextCurrencyAdjustments());
		}
		if (propertySource.nextBoolean()) {
			builder.setMemo(propertySource.nextString(100));
		}
		if (propertySource.nextBoolean()) {
			builder.setContractCallResult(propertySource.nextEvmFnResult());
		} else if (propertySource.nextBoolean()) {
			builder.setContractCreateResult(propertySource.nextEvmFnResult());
		}
		if (propertySource.nextBoolean()) {
			builder.setScheduleRef(propertySource.nextEntityId());
			builder.setParentConsensusTime(propertySource.nextInstant());
		}
		if (propertySource.nextBoolean()) {
			builder.setCryptoAllowances(propertySource.nextCryptoAllowances(1, 2, 4));
		}
		if (propertySource.nextBoolean()) {
			builder.setFungibleTokenAllowances(propertySource.nextFungibleAllowances(1, 2, 4, 8));
		}
		if (propertySource.nextBoolean()) {
			propertySource.nextTokenAdjustmentsIn(builder);
		}
		if (propertySource.nextBoolean()) {
			builder.setAssessedCustomFees(propertySource.nextAssessedFeesList());
		}
		if (propertySource.nextBoolean()) {
			builder.setNewTokenAssociations(propertySource.nextTokenAssociationsList());
		}
		final var seeded = builder.build();
		seeded.setSubmittingMember(propertySource.nextUnsignedLong());
		seeded.setExpiry(propertySource.nextUnsignedLong());
		return seeded;
	}

	private static String getHexedForm(final int version, final int testCaseNo) {
		return version == RELEASE_0230_VERSION ? hexedForms[testCaseNo] : hexedForms[testCaseNo + num0240Forms];
	}

	private static final int num0240Forms = 5;
	private static final String[] hexedForms = {
			// The 0.24 forms
			"",
			"",
			"",
			"",
			"",
			// The 0.25 forms
			"",
			"",
			"",
			"",
			"",
	};
}
